(function($){function getUrlVars(){var vars=[],hash;var hashes=window.location.href.slice(window.location.href.indexOf('?')+1).split('&');for(var i=0;i<hashes.length;i++){hash=hashes[i].split('=');vars.push(hash[0]);vars[hash[0]]=hash[1]}if("next"in vars){return vars["next"]}else{return'nothing'}}$(document).ready(function(){if($('input[name="checkout_url"]').length){var next=getUrlVars();if(next!='nothing'){$('input[name="checkout_url"]').val(next)}}})})(jQuery);
